import { motion } from 'framer-motion';
import styled from 'styled-components';



type Draggable = {
    howerscale?: number;
    tapscale?: number;
    dragscale?: number;
};

const defaultDraggable: Draggable = {
    howerscale: 0.95,
    tapscale: 0.95,
    dragscale: 0.95,
};

const DraggableComponent = styled(motion.div);

export default DraggableComponent;
